int findMaxLength(vector<int>& nums) {
    int result = 0;
    int actual_size = 0;
    int sum = 0;
    unordered_map<int,int> mp;
    mp[0] = -1;

    for (int i : nums) {
        sum += i == 0 ? -1 : 1;
        if (mp.find(sum) != mp.end())
            result = max(result, actual_size-mp[sum]);
        else
            mp[sum] = actual_size;
        actual_size++;
            
    }
    return result;
};

